import React from 'react';
import { Component } from "react";
import { Routes, Route } from 'react-router-dom'; 


import FirstApp from '../firstapp/FirstApp';
import CounterApp from '../counter/CounterApp';
import CounterAppHook from '../counter/CounterAppHook';
import MyComponentLife from "../lifecycle/MyComponentLife";
import DemoButtons from '../testydialog/DemoButtons';
import DemoButtonsHook from '../testydialog/DemoButtonsHook';
import BookApp from '../books/BookApp';
import PDatabaseApp from '../pdatabase/PDatabaseApp';
import PDatabaseAppHook from '../pdatabase/PDatabaseAppHook';
import NameForm from '../testydialog/NameForm';
import NameFormHook from '../testydialog/NameFormHook';
import DNameForm from '../testydialog/DNameForm';
import DNameFormHook from '../testydialog/DNameFormHook';
import TextAreaForm from '../testydialog/TextAreaForm';
import TextAreaFormHook from '../testydialog/TextAreaFormHook';
import ListForm from '../testydialog/ListForm';
import ListFormHook from '../testydialog/ListFormHook';
import RadiobuttonForm from '../testydialog/RadiobuttonForm';
import RadiobuttonFormHook from '../testydialog/RadiobuttonFormHook';
import CheckboxForm from '../testydialog/CheckboxForm';
import CheckboxFormHook from '../testydialog/CheckboxFormHook';
import ManyElemForm from '../testydialog/ManyElemForm';
import ManyElemFormValid from '../testydialog/ManyElemFormValid';

import  TwoWindows from "../testydialog/TwoWindows";
import LoginWindow from '../testydialog/LoginWindow';
import  RESTDataBasePerson from "../restbase/REST_NOAUTH_DataBasePerson";
import AppStorage from "../teststorage/AppStorage";
import  BankTransNoAuth from "../restbank/REST_NOAUTH_BankTrans";
import  BankTransBasicAuth from "../restbank/REST_BASICAUTH_BankTrans";
import  BootstrapDemo from "../bootstrapdemo/BootstrapDemo";
import  Table1 from "../testtable/Table1";
import  Table1Hook from "../testtable/Table1Hook";
import  Table2 from "../testtable/Table2";
import  Table2Hook from "../testtable/Table2Hook";
import  TestTabs from "../testtabs/TestTabs";
import  TestTabsHook from "../testtabs/TestTabsHook";
import  TestImage from "../testimage/TestImage";



class MenuGlobRoutes extends Component {

    constructor(props) {
        super(props);
    }

    render() {
        return (
            <Routes>                
                <Route path='/' element={<FirstApp />} />
                <Route path='/CounterApp' element={<CounterApp />} />                
                <Route path='/CounterAppHook' element={<CounterAppHook />} />                
                <Route path='/MyComponentLife' element={<MyComponentLife />} />    
                <Route path='/DemoButtons' element={<DemoButtons />} />            
                <Route path='/DemoButtonsHook' element={<DemoButtonsHook />} />            
                <Route path='/NameForm' element={<NameForm />} />
                <Route path='/NameFormHook' element={<NameFormHook />} />
                <Route path='/DNameForm' element={<DNameForm />} />
                <Route path='/DNameFormHook' element={<DNameFormHook />} />
                <Route path='/TextAreaForm' element={<TextAreaForm />} />
                <Route path='/TextAreaFormHook' element={<TextAreaFormHook />} />
                <Route path='/ListForm' element={<ListForm />} />
                <Route path='/ListFormHook' element={<ListFormHook />} />
                <Route path='/RadiobuttonForm' element={<RadiobuttonForm />} />
                <Route path='/RadiobuttonFormHook' element={<RadiobuttonFormHook />} />
                <Route path='/CheckboxForm' element={<CheckboxForm />} />
                <Route path='/CheckboxFormHook' element={<CheckboxFormHook />} />
                <Route path='/ManyElemForm' element={<ManyElemForm />} />
                <Route path='/ManyElemFormValid' element={<ManyElemFormValid />} />
                <Route path='/TwoWindows' element={<TwoWindows />} />
                <Route path='/LoginWindow' element={<LoginWindow />} />                                                
                <Route path='/BookApp' element={<BookApp />} />
                <Route path='/PDatabaseApp' element={<PDatabaseApp />} />
                <Route path='/RESTDataBasePerson' element={<RESTDataBasePerson />} />
                <Route path='/AppStorage' element={<AppStorage />} />
                <Route path='/BankTransNoAuth' element={<BankTransNoAuth />} />                
                <Route path='/BankTransBasicAuth' element={<BankTransBasicAuth />} />                
                <Route path='/BootstrapDemo' element={<BootstrapDemo />} />            
                <Route path='/Table1' element={<Table1 />} />            
                <Route path='/Table1Hook' element={<Table1Hook />} />            
                <Route path='/Table2' element={<Table2 />} />            
                <Route path='/Table2Hook' element={<Table2Hook />} />            
                <Route path='/TestTabs' element={<TestTabs />} />            
                <Route path='/TestTabsHook' element={<TestTabsHook />} />            
                <Route path='/TestImage' element={<TestImage />} />            
                
                
            </Routes>
        );
    }
}


export default MenuGlobRoutes;
